import React, { lazy, Suspense, useContext } from "react";
import { Route, Switch, BrowserRouter } from "react-router-dom";
import ThemeContext from '../context/ThemeContext';

const Home = lazy(() => import("../pages/home/HomeComponent"));
const AboutMe = lazy(() => import("../pages/aboutMe/AboutMe"));
const Services = lazy(() => import("../pages/services/ServicesComponent"));
const Education = lazy(() => import("../pages/education/EducationComponent"));
const Experience = lazy(() => import("../pages/experience/Experience"));
const Contact = lazy(() => import("../pages/contact/ContactComponent"));
const Projects = lazy(() => import("../pages/projects/Projects"));
const Error404 = lazy(() => import("../pages/errors/error404/Error"));

const Main = (props) => {
    const theme = useContext(ThemeContext);

    return (
        <div>
            <BrowserRouter basename="/">
                <Switch>
                    <Route path="/" exact>
                        <Suspense fallback={<div>Loading...</div>}>
                            <Home {...props} theme={this.props.theme} />
                        </Suspense>
                    </Route>
                    <Route path="/home">
                        <Suspense fallback={<div>Loading...</div>}>
                            <Home theme={theme} />
                        </Suspense>
                    </Route>
                    <Route path="/experience" exact>
                        <Suspense fallback={<div>Loading...</div>}>
                            <Experience theme={theme} />
                        </Suspense>
                    </Route>
                    <Route path="/about">
                        <Suspense fallback={<div>Loading...</div>}>
                            <AboutMe theme={theme} />
                        </Suspense>
                    </Route>
                    <Route path="/services">
                        <Suspense fallback={<div>Loading...</div>}>
                            <Services theme={theme} />
                        </Suspense>
                    </Route>
                    <Route path="/contact">
                        <Suspense fallback={<div>Loading...</div>}>
                            <Contact theme={theme} />
                        </Suspense>
                    </Route>
                    <Route path="/portfolio">
                        <Suspense fallback={<div>Loading...</div>}>
                            <Projects theme={theme} />
                        </Suspense>
                    </Route>
                    <Route path="/FAQ">
                        <Suspense fallback={<div>Loading...</div>}>
                            <Projects theme={theme} />
                        </Suspense>
                    </Route>
                </Switch>
            </BrowserRouter>
        </div>
    );
};

export default Main;
